import React from "react";

export default function MobileApp() {
  return (
    <div>
      <div className=" grid grid-cols-2 bg-purple ">
        <div className="grid grid-rows-2  mt-10 ml-10">
          <div>
          <p className = "text-gray  ">AVAILABLE ON ANDROID & APP STORE</p>
          <h2  className = "text-white font-bold">Build A Beautiful, Professional-Looking Online Course With Quiklearn</h2>
          </div>
          <div className = "bg-url('https://www.radiustheme.com/demo/wordpress/themes/quiklearn/wp-content/uploads/2023/08/shape-1-1.svg')  ">
          <button className = "border border-white rounded bg-blue h-12 w-52 mt-8 " >ddd</button>
          <button className = "border border-white rounded bg-blue h-12 w-52 mt-8 ml-10">111</button>
          </div>
        </div>
        <div></div>
      </div>
    </div>
  );
}
